//doubledots
VectorXd doubledots(VectorXd qthss){
	//iksolver
	VectorXd qx(6), dqx(6), qf(18), dqf(18), dqvals(6);
	qx = qthss.head(6);
	dqx = qthss.tail(6);
	qf = iksolver(qx);
	//Matrices for velocities
	MatrixXd Jthxval(6,6), dJthxval(6,6), Jetathval(12,6), Jetaphval(12,12), Jqthval(18,6), dJetathval(12,6), dJetaphval(12,12);
	Jthxval = Jthxmat(qx);
	dJthxval = dJthxmat(qx, dqx);
	//Jacobians for embedded formulation
	Jetathval = Jetathmat(qf);
	Jetaphval = Jetaphmat(qf);
	Jqthval << (-Jetaphval.inverse())*Jetathval, MatrixXd::Identity(6,6);
	//Velocities of the legs
	dqvals = Jthxval*dqx;
	dqf = Jqthval*dqvals;
	//Matrices for embedded Lagrangian method
	dJetathval = dJetathmat(qf, dqf);
	dJetaphval = dJetaphmat(qf, dqf);
	VectorXd Gval(18), dd(6), Gthval(6), Gxval(6);
	MatrixXd dJphthval(12,6), dJqthval(18,6), Mval(18,18), Cval(18,18), Mxval(6,6), Cxval(6,6), Mthval(6,6), Cthval(6,6);
	dJphthval << (Jetaphval.inverse())*(-dJetathval+dJetaphval*(Jetaphval.inverse())*Jetathval);
	dJqthval << dJphthval, MatrixXd::Zero(6,6);

	//Constructing the matrices
	Mval = Mmat(qf);
	Mthval = (Jqthval.transpose())*Mval*Jqthval;	
	Mxval = (Jthxval.transpose())*Mthval*Jthxval;	

	Cval = Cmat(qf, dqf);
	Cthval = (Jqthval.transpose())*(Mval*dJqthval+Cval*Jqthval);
	Cxval = (Jthxval.transpose())*(Mthval*dJthxval+Cthval*Jthxval);

	Gval = Gvec(qf);
	Gthval = (Jqthval.transpose())*Gval;
	Gxval = (Jthxval.transpose())*Gthval;

	//So the dd will be
	dd = -(Mxval.inverse())*(Cxval*dqx+Gxval);
	return dd;
}
